#include <iostream>

using namespace std;

#include <algorithm>
#include <vector>
#include <unordered_map>
#include <string>


class Ca {
public:
    vector<int> left;
    vector<int> right;

    Ca(int count) : left(count,0) , right(count,0) {

    }       

    Ca(const Ca& copy) {      
        left = copy.left;
        right = copy.right;
    }
};
class Solution {
public:
    string minWindow(string s, string t) {
        int s_l = s.length(), t_l = t.length();
        unordered_map<char, int> m_t;
        
        vector<int> Count_T; 
        int t_s = 0;
        for (int i = 0; i < t_l; ++i) {
            if(m_t.count(t.at(i))) {
                Count_T[m_t.find(t.at(i))->second]++;
            } else {
                Count_T.push_back(1);
                m_t[t[i]]= t_s++;
            }
        }
       
        pair<int,int> min = make_pair(999999,-1);
        vector<Ca> Count_A;
        Ca cp1(t_s);
        
        for (int i= 0 ; i < s_l; ++i) {
            
            if(m_t.count(s.at(i))) {
                cp1.right[m_t.find(s.at(i))->second]++;
                Ca cp2 = cp1;
                Count_A.push_back(cp2);
                cp1.left[m_t.find(s.at(i))->second]++;
               
            } else {
                Ca cp2 = cp1;
                Count_A.push_back(cp2);
                
            }
        }

        int b = 0 ;

        for(int a = 0 ; a < s_l; ++a) {

            if(!m_t.count(s.at(a)))
                continue;
            
            while(b != s_l-1 && !check(Count_A[a].left, Count_A[b].right, Count_T, Count_T.size())) {
                b++;
            }
            if (min.first >= (b - a + 1) && check(Count_A[a].left, Count_A[b].right, Count_T, Count_T.size())){
                min = {b-a+1, a};
            }
            
        }

        return min.second == - 1 ? "" : s.substr(min.second,min.first);
        
    }

    bool check(const vector<int> &left, const vector<int> &right, const vector<int> &total, int size) {
        bool b= true; 

        for(int i = 0; i < size; i++) {
            bool j = right[i] - left[i] - total[i] >= 0 ? 1 : 0;
            b = b & j;
            if(!b)
                return false;
        }
        return b;
    }
};


